import React from 'react'
import './NavBar.css'
import { Link } from "react-router-dom";
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar'; 
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';

function NavScrollExample() {
  return (
    <div>
      <div class="bs-example">
        <nav class="bg-body-tertiary navbar navbar-expand-lg navbar-dark" bg>
          <div class="container-fluid">
            <a href="#" class="navbar-brand">Navbar scroll</a>
            <button aria-controls="navbarScroll" type="button" aria-label="Toggle navigation" class="navbar-toggler collapsed">
              <span class="navbar-toggler-icon"></span>
            </button><div class="navbar-collapse collapse" id="navbarScroll">
            <div class="me-auto my-2 my-lg-0 navbar-nav navbar-nav-scroll smthng">
              <a href="#action1" data-rr-ui-event-key="#action1" class="nav-link">Home</a>
              <a href="#action2" data-rr-ui-event-key="#action2" class="nav-link">Link</a>
              <div class="nav-item dropdown">
                <a id="navbarScrollingDropdown" aria-expanded="false" role="button" class="dropdown-toggle nav-link" tabindex="0" href="#">Link</a>
              </div>
              <a role="button" data-rr-ui-event-key="#" class="nav-link disabled" aria-disabled="true">Link</a>
            </div>
            <form class="d-flex">
              <input placeholder="Search" aria-label="Search" type="search" class="me-2 form-control"/>
                <button type="button" class="btn btn-outline-success">Search</button>
              </form>
            </div>
          </div>
        </nav>
      </div>
    </div>
  );
}

export default NavScrollExample;
